import React from "react";
import { makeStyles, withStyles } from "@material-ui/core/styles";
import { TextField, Typography, Button, Grid, Box } from "@material-ui/core";
import arrow from "@material-ui/icons";
import Navbar from "./Navbar";

const InputField = withStyles({
  // withStyles, not makeStyles
  root: {
    "& label.Mui-focused": {
      // find these classes inspect element, styles
      color: "tomato",
    },
    "& label": {
      color: "tomato",
    },
    "& .MuiOutlinedInput-root": {
      "& fieldset": {
        borderColor: "tan",
      },
      "&:hover fieldset": {
        borderColor: "tan",
      },
      "&.Mui-focused fieldset": {
        borderColor: "tan",
      },
    },
  },
})(TextField);

const Contact = () => {
  return (
    <Box component="div">
      <Grid container justify="center">
        <Box component="form">
          <Typography variant="h5">tell me something</Typography>
          <InputField
            fullWidth={true}
            label="Name"
            variant="outlined"
            // inputProps={{ style: { color: "white" } }} // this is how to change the input text color
            margin="dense"
            size="medium"
          />
          <br />
          <InputField
            fullWidth={true}
            label="Name"
            variant="outlined"
            margin="dense"
            size="medium"
          />
          <br />
          <InputField
            fullWidth={true}
            label="Name"
            variant="outlined"
            margin="dense"
            size="medium"
          />
          <br />
          <Button variants="outlined" fullWidth={true} endIcon={<arrow />}>
            contact me
          </Button>
        </Box>
      </Grid>
    </Box>
  );
};

export default Contact;
